INSERT INTO `qk7ce_overrider` VALUES(377, 'COM_USERS_EMAIL_PASSWORD_RESET_BODY', 'Dobrý den,\\n\\nByl proveden požadavek na obnovení hesla k účtu %s. K dokončení obnovení hesla je třeba požadavek potvrdit ověřovacím kódem, abychom se ujistili, že jste požadavek provedli skutečně vy.\\n\\nOvěřovací kód je %s\\n\\nPro pokračování v procesu obnovení hesla klikněte na následující URL.\\n\\n S pozdravem \\n\\n%s', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
