INSERT INTO `qk7ce_overrider` VALUES(382, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY', 'Dobrý den %s,\\n\\nDěkujeme za registraci na %s. Váš účet je vytvořen, ale před tím, než se budete moci přihlásit, je třeba jej aktivovat.\\nPro aktivaci účtu klikněte na následující odkaz, nebo jej okopírujte a vložte do svého prohlížeče:\\n%s \\n\\nPo aktivaci se již budete moci na %s přihlásit pomocí následujícího uživatelského jména a hesla:\\n\\nUživatelské jméno: %s\\nHeslo: %s', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
INSERT INTO `qk7ce_overrider` VALUES(383, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY_NOPW', 'Dobrý den %s,\\n\\nDěkujeme za registraci na %s. Váš účet je vytvořen, ale před tím, než se budete moci přihlásit, je třeba jej aktivovat.\\nPro aktivaci účtu klikněte na následující odkaz, nebo jej okopírujte a vložte do svého prohlížeče:\\n%s \\n\\nPo aktivaci se již budete moci na %s přihlásit pomocí následujícího uživatelského jména a hesla:\\n\\nUživatelské jméno: %s', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
INSERT INTO `qk7ce_overrider` VALUES(384, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY', 'Dobrý den %s,\\n\\nDěkujeme vám za registraci na %s. Váš účet je vytvořen, ale před tím, než se budete moci přihlásit, je třeba jej ověřit.\\nPro ověření účtu klikněte na následující odkaz, nebo jej okopírujte a vložte do adresního řádku svého prohlížeče:\\n %s \\n\\nPo ověření bude správci odeslána žádost o aktivaci účtu. O aktivaci účtu budete informováni.\\n Jakmile bude účet aktivován, budete se na %s moci přihlásit pomocí následujícího uživatelského jména a hesla:\\n\\nUživatelské jméno: %s\\nHeslo: %s', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
INSERT INTO `qk7ce_overrider` VALUES(385, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY_NOPW', 'Dobrý den %s,\\n\\nDěkujeme vám za registraci na %s. Váš účet je vytvořen, ale před tím, než se budete moci přihlásit, je třeba jej ověřit.\\nPro ověření účtu klikněte na následující odkaz, nebo jej okopírujte a vložte do adresního řádku svého prohlížeče:\\n %s \\n\\nPo ověření bude správci odeslána žádost o aktivaci účtu. O aktivaci účtu budete informováni.\\n Jakmile bude účet aktivován, budete se na %s moci přihlásit pomocí následujícího uživatelského jména a hesla:\\n\\nUživatelské jméno: %s', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
