INSERT INTO `qk7ce_overrider` VALUES(388, 'COM_USERS_ERROR_SECRET_CODE_WITHOUT_TFA', 'Máte zadán tajný klíč, ale dvoufázové ověření není ve vašem uživatelském účtu povoleno. Pokud chcete pro zvýšení zabezpečení vašeho přihlášení použít tajný klíč, přejděte do svého uživatelského profilu a dvoufázové ověření povolte.', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.com_users.ini');
