INSERT INTO `qk7ce_overrider` VALUES(1628, 'JLIB_RULES_SETTING_NOTES', '1. Změníte-li nastavení, bude použito pro tuto a všechny vnořené skupiny, rozšíření a obsah. Nezapomeňte že: <em>Zakázáno</em> přepíše jakákoliv zděděná nastavení a také nastavení v jakékoliv vnořené skupině, komponentě nebo obsahu. V případě konfliktu nastavení, <em>Odepřít</em> bude mít přednost. <em>Nenastaveno</em> je ekvivalentní k <em>Zakázáno</em> ale může být změněno ve vnořených skupinách, rozšířeních a obsahu.<br />2. Zvolíte-li nové nastavení, klikněte pro obnovení vypočítaného nastavení na <em>Uložit</em>.', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.lib_joomla.ini');
INSERT INTO `qk7ce_overrider` VALUES(1629, 'JLIB_RULES_SETTING_NOTES_ITEM', '1. Změníte-li nastavení, bude použito pro tuto položku. Nezapomeňte že:<br /><em>Zděděno</em> znamená, že budou použita globální nastavení nebo nastavení nadřazené skupiny a kategorie.<br /><em>Zakázáno</em> znamená, že bez ohledu na globální nastavení, nastavení nadřazené skupiny nebo kategorie tato skupina nemá k této činnosti pro tuto položku oprávnění.<br /><em>Povoleno</em> znamená, že tato skupina bude moci tuto činnost pro tuto položku provádět (ale pokud je to v rozporu s globálním nastavením, s nastavením nadřazené skupiny nebo kategorie, nebude to mít žádný vliv; konflikt bude podle vypočteného nastavení indikován jako <em>Nepovoleno (Zamčeno)</em>).<br />2. Zvolíte-li nové nastavení, klikněte pro obnovení vypočítaného nastavení na <em>Uložit</em>.', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.lib_joomla.ini');
