INSERT INTO `qk7ce_overrider` VALUES(2107, 'MOD_RELATED_XML_DESCRIPTION', 'Tento modul zobrazuje další články, které se vztahují k právě zobrazenému článku. Tyto vztahy jsou založeny na Meta Keywords. <br />Všechna klíčová slova stávajícího článku jsou vyhledávána v klíčových slovech všech ostatních zveřejněných článků. Můžete mít například článek o \"chovu papoušků\" a další o \"rozmnožování Kakadu Černých v zajetí\". Vložíte-li klíčové slovo \"papoušek\" do klíčových slov obou článků, pak při prohlížení článku o \"rozmnožování Kakadu Černých v zajetí\" modul Související položky zobrazí související článek o \"chovu papoušků\" a naopak.', '/home/k/projects/netaktiv/language/cs-CZ/cs-CZ.mod_related_items.ini');
